const { Q } = require('pp-mysql/client').shorthands();
const { LoanCItemBase } = require('./loancitembase');

/// Loan custom item
class LoanCItem extends LoanCItemBase {
    static joinCItem() {
        return `INNER JOIN ${this.jsonTable()} AS ${Q(this.jsontable)}`;
    };
}

module.exports = { LoanCItem };
